        return console.log(1,type)
        setContent(type)
    }
    return( 
        <div className='name'>
          
          <Header>
            
            <button type="button" onClick={()=>handleClick('больше не нажимай')}>{content}</button>
            
            </Header>

    
          <Main />
          <Footer />
        </div>
    )
}
